import React, {useState} from 'react';

function Heading () {
    var time =  new Date().getHours();
    var greeting;
    var entername;
    var [numberz, setNumber] = useState(new Date())
    
    var sitai = {
    color: "yellow",
    fontSize: "20px",
    }
    setInterval ( () => {setNumber(numberz = new Date())});
    if (time >= 0 && time < 12){
        greeting = "Good morning, it's " + numberz;
        sitai.color = "red";
    } else if (time >= 12 && time < 18){
        greeting = "Good afternoon, it's " + numberz;
        sitai.color = "blue";
    } else {
        greeting = "Good evening, it's " + numberz;
        sitai.color = "green";
    }
    return  <h1 style = {sitai}>{greeting}</h1>
}

function Cardz(propz) {
    return ( 
    <div className = "contact">
      <p>{propz.id}</p>  
      <p>{propz.name}</p>
      <p>{propz.tel}</p>
      <p>{propz.email}</p>
    </div>
    );
  }
  
export default Heading;
export {Cardz}
